import React from "react";

function Home() {
  return (
    <section id="home" className="relative bg-[#0f0f0f] text-white min-h-screen flex flex-col justify-center items-center">
      <div className="text-center">
        {/* Massive Logo */}
        <img
          src="./img/logo.jpg"
          alt="Logo"
          className="w-64 h-64 mb-10 mx-auto" 
        />
        {/* Welcome Text */}
        <h1 className="text-8xl font-bold text-[#ffcc70]">Welcome to Our Portfolio</h1>
      </div>
    </section>
  );
}

export default Home;
